void help(const char *args)
{
	(void) (args);

	print("Available commands: ");

	for (auto &command: commands) {
		print(command.cmd);
		print(", ");
	}

	println("");
}

void clear(const char *args)
{
	(void) (args);
	clear_screen();
}

void time(const char *args)
{
	(void) (args);

	struct DateTime t = get_rtc();

	char buf[20];

	print(pad(2, '0', itoa(t.hour, buf)));
	print(":");
	print(pad(2, '0', itoa(t.minute, buf)));

	print(" ");

	print(pad(2, '0', itoa(t.day, buf)));
	print(".");
	print(pad(2, '0', itoa(t.month, buf)));
	print(".");
	print(itoa(t.year, buf));

	println("");
}

void sleep(const char *args)
{
	(void) (args);
	wait(2000);
}

void draw(const char *args)
{
	(void) (args);

	switch_vga_mode();

	uint16_t offx = VGA_WIDTH / 2 - 100;
	uint16_t offy = VGA_HEIGHT / 2 - 100;

	for (uint16_t x = 0; x < 200; x++) {
		for (uint16_t y = 0; y < 200; y++) {
			put_pixel(x + offx, y + offy, lenna[(y * 200) + x]);
		}
	}
}

void test(const char *args)
{
	(void) (args);
	switch_vga_mode();

	float length = 50;
	Vector3 a = {VGA_WIDTH / 2.0f - length / 2, VGA_HEIGHT / 2.0f - length / 2, 0};
	Vector3 b = a + Vector3{length, 0, 0};
	Vector3 c = a + Vector3{length, length, 0};
	Vector3 d = a + Vector3{0, length, 0};

	Vector3 e = a + Vector3{0, 0, length};
	Vector3 f = b + Vector3{0, 0, length};
	Vector3 g = c + Vector3{0, 0, length};
	Vector3 h = d + Vector3{0, 0, length};

	Rectangle r1(a, b, c, d);
	Rectangle r2(e, f, g, h);
	Rectangle r3(a, b, f, e);
	Rectangle r4(d, c, g, h);
	Rectangle r5(a, e, h, d);
	Rectangle r6(b, f, g, c);

	float x = 0, y = 0, z = 0;
	Vector3 origin = (a + f) / 2;

	while (true) {
		r1.rotate(x, y, z, origin).draw(0xe);
		r2.rotate(x, y, z, origin).draw(0xe);
		r3.rotate(x, y, z, origin).draw(0xe);
		r4.rotate(x, y, z, origin).draw(0xe);
		r5.rotate(x, y, z, origin).draw(0xe);
		r6.rotate(x, y, z, origin).draw(0xe);

		wait(20);

		r1.rotate(x, y, z, origin).draw(0x0);
		r2.rotate(x, y, z, origin).draw(0x0);
		r3.rotate(x, y, z, origin).draw(0x0);
		r4.rotate(x, y, z, origin).draw(0x0);
		r5.rotate(x, y, z, origin).draw(0x0);
		r6.rotate(x, y, z, origin).draw(0x0);

		x += 0.005;
		y += 0;
		z += 0;
	}
}